import { enumMedia, enumStatus, enumType } from "@configs";

export interface IMerchant {
    _id?: string;
    name: string;
    subColor?: string;
    themeColor: string;
    logoUrl: string;
    googleAnalytics?: string;
    createdBy?: string;
    signUpMethod: enumMedia[];
    welcomeImageUrls?: string[];
    welcomeDescription?: string;
    welcomeColor?: string;
    additionalFields?: IAdditionalField[];
    levels?: ILevelId;
    planId?: string;
    status?: enumStatus;
}

export interface IAdditionalField {
    _id?: string;
    label: string;
    type: enumType;
    typeOptions: string[];
    isRequired: boolean;
}

export interface ILevelId {
    _id?: string;
    name: string;
    description: string;
    point: number;
    status: enumStatus;
}
